import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AgeCategoryRanking() {
  const [rankingData, setRankingData] = useState([]);
  const year = 2025; // 조회 연도
  const startMonth = 1; // 시작 월
  const endMonth = 6;  // 종료 월

  // 연령대별 카테고리 판매 순위 데이터 가져오기
  useEffect(() => {
    const fetchRankingData = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/admin/sales/age-group?year=${year}&startMonth=${startMonth}&endMonth=${endMonth}`);
        setRankingData(response.data);
      } catch (err) {
        console.error('Error fetching ranking data:', err);
      }
    };

    fetchRankingData();
  }, [year, startMonth, endMonth]);

  // 연령대별 카테고리 판매 순위 렌더링
  const renderAgeCategoryRanking = (ageGroup) => {
    const ageGroupData = rankingData.filter(item => item.ageGroup === ageGroup);

    return (
      <div key={ageGroup} className="age-category-ranking">
        <h3>{ageGroup}대 카테고리별 판매량 순위</h3>
        {ageGroupData.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>순위</th>
                <th>카테고리</th>
                <th>판매량</th>
              </tr>
            </thead>
            <tbody>
              {ageGroupData.map((item, index) => (
                <tr key={index}>
                  <td>{index + 1}</td>
                  <td>{item.category}</td>
                  <td>{item.sales}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>데이터가 없습니다.</p>
        )}
      </div>
    );
  };

  return (
    <div className="age-category-ranking-container">
      {['10', '20', '30', '40', '50'].map(ageGroup => renderAgeCategoryRanking(ageGroup))}
    </div>
  );
}

export default AgeCategoryRanking;
